import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Avatar,
  Box,
  Button,
  Card,
  CardContent,
  CardActions,
  Divider,
  Grid,
  IconButton,
  Stack,
  TextField,
  Typography
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';

const Profile = () => {
  const navigate = useNavigate();

  // Example local state (in a real app, these might come from an API or Redux/Context)
  const [profilePic, setProfilePic] = useState('https://via.placeholder.com/150');
  const [name, setName] = useState('John Doe');
  const [dateOfBirth, setDateOfBirth] = useState('1990-01-01');
  const [sex, setSex] = useState('Male');
  const [userType, setUserType] = useState('Student');

  const handleProfilePicChange = (e) => {
    const file = e.target.files?.[0];
    if (!file) return;

    const imageUrl = URL.createObjectURL(file);
    setProfilePic(imageUrl);

    // In a real application, you would also upload the file to the server here
    // e.g. using fetch or Axios, then store the server's URL in your state.
  };

  // Called when user clicks "Logout"
  const handleLogout = () => {
    // Clear tokens, etc.
    // localStorage.removeItem('token') or similar
    navigate('/login'); // or wherever your login page is
  };

  // Called when user clicks "Back to Dashboard"
  const handleBackToDashboard = () => {
    navigate('/dashboard'); // adjust path based on your routing
  };

  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        p: 2,
      }}
    >
      <Card sx={{ maxWidth: 600, width: '100%', p: 2 }}>
        <CardContent>
          <Grid container spacing={2} alignItems="center">
            <Grid item xs={12} sm={4} md={3}>
              <Box position="relative" display="inline-block">
                <Avatar
                  alt="Profile Picture"
                  src={profilePic}
                  sx={{ width: 120, height: 120, mb: 1 }}
                />
                <IconButton
                  sx={{
                    position: 'absolute',
                    bottom: 0,
                    right: 0,
                    backgroundColor: 'white',
                    border: '1px solid #ccc'
                  }}
                  aria-label="edit-picture"
                  component="label"
                >
                  <EditIcon />
                  <input
                    type="file"
                    hidden
                    accept="image/*"
                    onChange={handleProfilePicChange}
                  />
                </IconButton>
              </Box>
            </Grid>

            <Grid item xs={12} sm={8} md={9}>
              <Typography variant="h5" fontWeight="bold">
                {name}
              </Typography>
              <Typography variant="body1" color="text.secondary">
                {userType}
              </Typography>
            </Grid>
          </Grid>

          <Divider sx={{ my: 2 }} />

          {/* Additional user details */}
          <Stack spacing={2}>
            <TextField
              label="Full Name"
              variant="outlined"
              value={name}
              onChange={(e) => setName(e.target.value)}
            />
            <TextField
              label="Date of Birth"
              type="date"
              variant="outlined"
              value={dateOfBirth}
              onChange={(e) => setDateOfBirth(e.target.value)}
              InputLabelProps={{ shrink: true }}
            />
            <TextField
              label="Sex"
              variant="outlined"
              value={sex}
              onChange={(e) => setSex(e.target.value)}
            />
            <TextField
              label="User Type"
              variant="outlined"
              value={userType}
              onChange={(e) => setUserType(e.target.value)}
            />
          </Stack>
        </CardContent>

        <CardActions sx={{ justifyContent: 'space-between' }}>
          <Button
            variant="contained"
            color="primary"
            onClick={handleLogout}
          >
            Logout
          </Button>
          <Button
            variant="outlined"
            color="secondary"
            onClick={handleBackToDashboard}
          >
            Back to Dashboard
          </Button>
        </CardActions>
      </Card>
    </Box>
  );
};

export default Profile;
